import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { FormGroup, Label } from 'reactstrap';
import Visa from '../images/Visa.png';
import MasterCard from '../images/Mastercard.png';
import AmericanCard from '../images/American-Express.png';

export default class CardItem extends React.Component {
	render() {
		return (
			<div
				style={{
					display: 'flex',
					justifyContent: 'space-around',
					backgroundColor: '#255882',
					height: '8rem'
				}}
			>
				<FormGroup style={{ display: 'flex', paddindRight: '10px' }}>
					<Label style={{ color: 'grey' }}>Votre type de carte</Label>
					<img src="`url(${Visa})`" />
					<img src="`url(${Mastercard})`" />
					<img src="`url(${AmericanCard})`" />
				</FormGroup>
			</div>
		);
	}
}
